g.script:


var cnt = 0;

var svgElement = document.getElementById("svg_1");
svgElement.addEventListener("mouseover", mouseOver);
svgElement.addEventListener("mouseout", mouseOut);


function mouseOver() {

/*
  svgElement = document.getElementById("svg_1");
  svgElement.setAttributeNS(null, "fill", "#FF0000" )
*/
