}

function mouseOut() {
  svgElement = document.getElementById("svg_1");
  svgElement.setAttributeNS(null, "fill", "#FFFF00" )
}


  function setLED(led,n) {
    obj1=document.getElementById("svg_"+(led*1+1)); 
    if ( (n & 1) == 0 ){ 
      obj1.setAttributeNS(null, "fill", "#3F0000" )
    } else {
      obj1.setAttributeNS(null, "fill", "#FFEF00" )
    }
  }


  function setNextLED() {


    setLED(cnt,0)
    cnt++
    if ( cnt > 63 ){
      cnt=0
    }
    setLED(cnt,1)

  }  

  setLED(10,0)
  setLED(20,0)
  setLED(30,0)
  setLED(40,0)

  cnt=0
  window.setInterval( "setNextLED()",300)
